  false,\n\t\"url\": null,\n\t\"notes\": \"Optical, active acoustics, and research
  fishing data on bottomfish abundance and biomass were collected over predetermined
  grids to compare results of methodologies.  Optical data were collected using a
  baited stationary Botcam, a TOAD (tethered optical assessment device) camera, and
  an AUV.  Acoustics data were collected using a narrow-beam EK60 system operating
  at 38, 70, and 120 kHz frequencies.  Research fishing was conducted using hook-and-line
  on small boats.  Simultaneous AUV and active acoustics were operated to assess whether
  AUV can be used to optically validate acoustic data.  Bottomfishing off the Sette
  were conducted simultaneously with acoustics data collection for groundtruthing
  of acoustics data.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
